objetoCompra:
O curso de Power Bi acelerador pode contribuir para:

1. Ampliar o suporte no processo decisório da universidade a partir de painéis de dados;

2. Fornecer mais transparência para sociedade através da divulgação de dados;

Além disso, irá auxiliar no processo de coleta e preenchimento dos dados do Censo da Educação Superior, bem como nas suas respectivas auditorias;
